Records documenting Vietnam War-era protest groups (not including fraternities or
        sororities) can be found for the April 24th Committee; Campus Committee for Peace in Asia;
        Demonstrations; Friends of the Indochinese People; Milwaukee Organizing Committee;
        Student-Faculty Committee To End The War In Vietnam; Students for a Democratic Society;
        Students to Support Milwaukee 14; Students United for a Strong Stand in Vietnam; UWM
        Anti-War Committee; UWM Community Vietnam Moratorium Committee; and Vietnam Veterans Against
        the War.
